import { Link } from 'react-router-dom';

function Home() {
  return (
    <div>
      <h1>견적서 생성기 선택</h1>
      <ul>
        <li><Link to="/customs">1. 통관 견적서</Link></li>
        <li><Link to="/consulting">2. 컨설팅 견적서</Link></li>
        <li><Link to="/fta">3. FTA 견적서</Link></li>
        <li><Link to="/form">4. 과세자료 제출 컨설팅 견적서</Link></li>
      </ul>
    </div>
  );
}

export default Home;
